DATA[As we do multiple tests, we compute the \u0160id\u00e1k correction and get a significance level of 0.0014.]]\u003e\u003c/Text\u003e\u003c/Page\u003e\u003c/Pages\u003e\u003c/Report\u003e", width: "", output_is_light_prose: false };
